import { useEffect } from "react";
import Header from "./Header";


function Home(){


    useEffect(()=>{
        if(!localStorage.getItem('token')){
            Navigate('/login')
        }
    },[])




    return (
        <div>
            <Header/>
            welcome to home page
        </div>
    )
}

export default Home;
